import React, { useState, useEffect } from "react";

const LogAnalyzer = () => {
    const [unauthorizedLogs, setUnauthorizedLogs] = useState([]);
    const [sqlLogs, setSqlLogs] = useState([]);
    const [error, setError] = useState("");

    useEffect(() => {
        fetchLogs();
    }, []);

    const fetchLogs = async () => {
        try {
            await fetchUnauthorizedLogs();
            await fetchSQLLogs();
        } catch (err) {
            setError("Error fetching logs. Please try again.");
            console.error(err);
        }
    };

    const fetchUnauthorizedLogs = async () => {
        try {
            const response = await fetch("http://localhost:5000/api/unauthorized-access");
            if (!response.ok) throw new Error("Failed to fetch Unauthorized Access Logs");
            const data = await response.json();
            
            console.log("üîç Unauthorized Access Logs:", data);  // Debugging: Log full response
            setUnauthorizedLogs(data);
        } catch (error) {
            console.error("‚ùå Unauthorized Access Logs Fetch Error:", error);
            setError("Error fetching Unauthorized Access logs.");
        }
    };

    const fetchSQLLogs = async () => {
        try {
            const response = await fetch("http://localhost:5000/api/sql-logs");
            if (!response.ok) throw new Error("Failed to fetch SQL Injection Logs");
            const data = await response.json();
            setSqlLogs(data);
        } catch (error) {
            console.error("‚ùå SQL Logs Fetch Error:", error);
            setError("Error fetching SQL Injection logs.");
        }
    };

    return (
        <div>
            <h2>Unauthorized Access Logs</h2>
            {error && <p style={{ color: "red" }}>{error}</p>}
            {unauthorizedLogs.length === 0 ? (
                <p>No Unauthorized Access Logs available.</p>
            ) : (
                <table border="1">
                    <thead>
                        <tr>
                            <th>Source IP</th>
                            <th>Destination IP</th>
                            <th>Access Type</th>
                            <th>User Agent</th>
                            <th>HTTP Status</th>  {/* Ensure this field is displayed */}
                        </tr>
                    </thead>
                    <tbody>
                        {unauthorizedLogs.map((log, index) => (
                            <tr key={index}>
                                <td>{log.source_ip}</td>
                                <td>{log.destination_ip}</td>
                                <td>{log.access_type}</td>
                                <td>{log.user_agent}</td>
                                <td>{log.http_status_code_response || "N/A"}</td>  {/* Handle missing field */}
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}

            <h2>SQL Injection Logs</h2>
            {sqlLogs.length === 0 ? (
                <p>No SQL Injection Logs available.</p>
            ) : (
                <table border="1">
                    <thead>
                        <tr>
                            <th>Source IP</th>
                            <th>Destination IP</th>
                            <th>SQL Query</th>
                            <th>User Agent</th>
                            <th>HTTP Status</th>
                        </tr>
                    </thead>
                    <tbody>
                        {sqlLogs.map((log, index) => (
                            <tr key={index}>
                                <td>{log.source_ip}</td>
                                <td>{log.destination_ip}</td>
                                <td>{log.sql_query}</td>
                                <td>{log.user_agent}</td>
                                <td>{log.http_status_code_response || "N/A"}</td> 
                            </tr>
                        ))}
                    </tbody>
                </table>
            )}
        </div>
    );
};

export default LogAnalyzer;
